import React, { useEffect, useState } from 'react'
import '../../cssHelper/helper.css'
import './Player.css'
import ReactJkMusicPlayer from 'react-jinke-music-player'
import 'react-jinke-music-player/assets/index.css'


function Player() {

  const [audioLists, setAudioLists] = useState([
    { musicSrc: 'https://open.spotify.com/search/dual%20lipa' },
    { musicSrc: 'https://open.spotify.com/search/dual%20lipa' },
  ])

  useEffect(() => {
    setTimeout(() => {
      setAudioLists([{ musicSrc: 'https://open.spotify.com/search/dual%20lipa' }, { musicSrc: 'https://open.spotify.com/search/dual%20lipa' }, { musicSrc: 'https://open.spotify.com/search/dual%20lipa' }])
    }, 1000)
  }, [setAudioLists])

  return (
    <div className='Player'>
      <ReactJkMusicPlayer showLyric={true} audioLists={audioLists} />
    </div>
  )
}

export default Player
